var audio = this.parameters["gameContext"].audio;

var sound = new ArcSound("HitSound", true, this.parameters["modulePath"] + "/sound/effects/Metallic_Clank.mp3");
sound.loop = false;
audio.loadSound(sound, false, function(error){
        console.log("Error loading sound: " + url);
});

var playerActionState = 0;

this.playerHelped = function(caller, player, world, worldAdapter){
	++playerActionState;

	switch(playerActionState){
		case 1:
			var guard = world.getObject("Guard1");
			guard.updateLocation(guard.stats.initialLocation[0], guard.stats.initialLocation[1]);
			guard = world.getObject("Guard2");
			guard.updateLocation(guard.stats.initialLocation[0], guard.stats.initialLocation[1]);
			guard = world.getObject("Guard3");
			guard.updateLocation(guard.stats.initialLocation[0], guard.stats.initialLocation[1]);
			break;

		case 2:
			var person = world.getObject("MarketPerson3");
			person.updateLocation(person.stats.initialLocation[0], person.stats.initialLocation[1]);
			break;
	}
	console.log("Trigger state: " + playerActionState);
};


this.playerCaught = function(npc, player, worldAdapter){
	var parent = this.parameters.generated_map.parent;

	var afterDialog = function(){
		player.hasControl = true;
		game.display.camera.addAction(new ArcCameraMosaic(5000, function(camera){}, 0.0001, 1.0));
	};
	var afterBump = function(camera){
		parent.load("jail", "MainStart");
		 npc.TriggerDialog('GUARD_2', worldAdapter, player,  afterDialog);		
	};

	worldAdapter.module.stopBackgroundMusic(0);
	audio.playSound(sound, 0);
	game.display.camera.addAction(new ArcCameraMosaic(1000, afterBump, 1.0, 0.001));
};

var _this = this;
if(!this.properties["taskComplete"]){
	var taskCompleted = function(){
		_this.properties["taskComplete"] = true;

		world.getObject("CatchPlayerEvent").playerHelped(_this, player, world, worldAdapter);
	};

	var openTask = function(){
		if(_this.properties["taskRequested"]){
			var t = _this.TriggerTask('PaintBrush2', worldAdapter, taskCompleted);
			t.setBackground( worldAdapter.module.path + "/tasks/coin_string_dotted.png");
			t.setTitle("Coins");
		}
	};

	this.TriggerDialog('MARKET_1', worldAdapter, player, openTask);
}

